import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Title from '../Title/Title';

function preventDefault(event) {
  event.preventDefault();
}

// Generate Order Data
function createData(id, date, caseNumbers, guesses, winner) {
  return { date, caseNumbers, guesses, winner};
}

const result = [
  createData('8 May, 2019', 408, {'Rhys' : 300, 'Remco' : 200, 'Marius' : 400}, 'Marius')
];

const useStyles = makeStyles({
  depositContext: {
    flex: 1,
  },
});

export default function LastResult() {
  const classes = useStyles();
  return (
    <React.Fragment>
      <Title>Last Result</Title>
      <Typography color="textSecondary" className={classes.depositContext}>
        8 May, 2021
      </Typography>
      <Table size="small">
        <TableHead>
          <TableRow>
            <TableCell>Date</TableCell>
            <TableCell>Name</TableCell>
            <TableCell>Ship To</TableCell>
            <TableCell>Payment Method</TableCell>
            <TableCell align="right">Sale Amount</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.date}</TableCell>
              <TableCell>{row.name}</TableCell>
              <TableCell>{row.shipTo}</TableCell>
              <TableCell>{row.paymentMethod}</TableCell>
              <TableCell align="right">{row.amount}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </React.Fragment>
  );
}
